import React from 'react';

const UploadFile = () => {
    return (
        <React.Fragment>
            <p className='display-6 text-center mb-3'>Upload Stock Image</p>
            {/* <div className='mb-5 d-flex align-items-center justify-content-center'> idont Know</div> */}
            <form className="mb-2" style={{ textAlign: "left" }}>
                <div className="mb-3">
                    <input type="text" className="form-control" name="title" placeholder='Title' aria-describedby='text' id="formFile" />
                </div>
                <div className="mb-3">
                    <input className="form-control" type="file" id="formFile" />
                </div>
                <div className="col-auto">
                    <button type="submit" className="btn btn-success float-end">Save changes</button>
                </div>
            </form>
        </React.Fragment>
    )
}

export default UploadFile;
